import React, { Component } from 'react';
import Image from './Image';
import cycle from './cycle.jpg';
import shop3 from './shop3.jpg';
import Error from './Error'

export default class App extends Component {
    render() {
        return (
            <div>
                <Error>
                    <Image photo={shop3} />
                    </Error>
                    <Error>
                    <Image photo={cycle} />
                    <Image photo='No image' />
                   
                </Error>
                
            </div>
        )
    }
}
